import React from 'react';
import styled from "styled-components";

const Trade = props => {
  const { trade } = props;


  const CSS = styled.div`
    .trade-card{

    font-size: 16px;
    padding: 1%;
    box-shadow: rgba(0, 0, 0, 0.25) 0px 0.0625em 0.0625em, rgba(0, 0, 0, 0.25) 0px 0.125em 0.5em, rgba(255, 255, 255, 0.1) 0px 0px 0px 1px inset;
    }

  `;
  return (
    <CSS>
      <div className="trade-card">
        <div className='card w-50 text-danger'>
          Purchase date:<br/>
          {trade.buyDate}<br/>
          Purchase price:<br/>
          {trade.buyPrice}<br/>
          Indicator at Purchase:<br/>
          {trade.indicatorAtBuy}
        </div>
        <div className='card w-50 text-info'>
          Sell date:<br/>
          {trade.sellDate}<br/>
          Sell price:<br/>
          {trade.sellPrice}<br/>
          Indicator at Sell:<br/>
          {trade.indicatorAtSell}
        </div>
      </div>
      <div className='row card text-warning'>
        Number of shares:<br/>
        {trade.numShares.toFixed(2)}<br/>
        Profit Percent:<br/>
        ${trade.profitUSD.toFixed(2)}({trade.profitPercent>0?"+":""}{(trade.profitPercent*100).toFixed(2)}%)<br/>
        Candle Length:<br/>
        {trade.candleLength.toFixed(2)}<br/>
      </div>
      <br/>
    </CSS>
  )
}

export default Trade;
